import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { bookingAPI, getImageURL } from '../../services/api';
import './MyBookings.css';

function MyBookings() {
  const navigate = useNavigate();
  const [bookings, setBookings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    loadBookings();
  }, []);

  const loadBookings = async () => {
    try {
      setLoading(true);
      const response = await bookingAPI.getUserBookings();
      
      // Accessing response.data.data because of the controller structure
      const bookingsData = response.data.data || [];
      setBookings(bookingsData);
      setLoading(false);
    } catch (err) {
      console.error('‚ùå Frontend Error:', err);
      setError('Failed to load bookings. Please check if the server is running.');
      setLoading(false);
    }
  };

  const formatDate = (dateString) => {
    if (!dateString) return 'N/A';
    return new Date(dateString).toLocaleDateString();
  };

  const getStatusColor = (status) => {
    switch(status?.toLowerCase()) {
      case 'confirmed': return '#27ae60';
      case 'cancelled': return '#e74c3c';
      default: return '#f39c12';
    }
  };

  if (loading) return <div className="loading-container"><div className="spinner"></div><p>Loading...</p></div>;

  return (
    <div className="my-bookings-container">
      <div className="bookings-header">
        <h1>My Bookings</h1>
        <button className="back-btn" onClick={() => navigate('/')}>‚Üê Home</button>
      </div>

      {error && <div className="error-message">‚ö†Ô∏è {error}</div>}

      {bookings.length === 0 && !error ? (
        <div className="no-bookings">
          <h2>No bookings found</h2>
          <button className="browse-btn" onClick={() => navigate('/')}>Browse Art</button>
        </div>
      ) : (
        <div className="bookings-grid">
          {bookings.map((booking) => (
            <div key={booking.booking_id} className="booking-card">
              <div className="booking-card-header">
                <span className="booking-id">ID: #{booking.booking_id}</span>
                <span className="status-badge" style={{ backgroundColor: getStatusColor(booking.status) }}>
                  {booking.status?.toUpperCase()}
                </span>
              </div>

              <div className="booking-artwork">
                <img src={getImageURL(booking.image_url)} alt={booking.artwork_title} />
                <div className="info">
                  <h3>{booking.artwork_title || 'Untitled Artwork'}</h3>
                  <p>By {booking.artist_name || 'Unknown Artist'}</p>
                  <p className="price">NPR {Number(booking.total_amount).toLocaleString()}</p>
                </div>
              </div>

              <div className="booking-details">
                <p>üìÖ <strong>Date:</strong> {formatDate(booking.preferred_date)}</p>
                <p>üïê <strong>Time:</strong> {booking.preferred_time}</p>
                <p>üìç <strong>Address:</strong> {booking.delivery_address}</p>
                <p>üë§ <strong>Customer:</strong> {booking.customer_name}</p>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default MyBookings;
